p>','<p>Mengusulkan untuk memanfaatkan medsos dengan menggaet influencer untuk staycation di hotel dan menunjukan keindahan hotel</p>','<p>Mengusulkan untuk mengganti interior hotel agar lebih menarik pelanggan</p>','<p>Mengusulkan untuk memberikan layanan tambahan dan voucher tiket gratis pada pengunjung pertama di setiap bulan</p>',4,3,5,1,2,0,1,3,NULL,1),('00c61830-348c-49b4-9218-c9b6405d9147','2023-10-18 12:29:27','2023-10-18 12:29:27',NULL,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Saya sedang ujian SKD, waktu tersedia hanya 5 menit lagi namun ada 20 soal yang belum saya kerjakan. Saya...</p>','<p>tidak memperdulikannya dan berusaha sebaik mungkin</p>','<p>diam untuk menutupi kecemasan anda</p>','<p>mengerjakan dengan teliti dan berusaha sebaik mungkin</p>','<p>khawatir tidak terselesaikan</p>','<p>memikirkannya hingga menjadi tidak fokus</p>',4,3,5,2,1,0,1,3,NULL,1),('00dc3836-bd80-4b55-8f9d-6bd64c7a22b4','2023-10-18 10:22:40','2023-10-18 10:22:40',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>Dari lima gambar berikut manakah yang berbeda&hellip;</p>\n<p><img src=\"/storage/upload_files/questions/20231018101804soal 35.jpg\" alt=\"\" width=\"524\" height=\"118\" /></p>','<p>Gambar A</p>','<p>Gambar B</p>','<p>Gambar C</p>','<p>Gambar D</p>','<p>Gambar E</p>',0,0,0,0,0,0,1,3,NULL,1),('0149e9ee-8ad0-4910-b69e-3b3a2247813e','2023-10-17 15:35:52','2023-10-17 15:35:52',NULL,'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f',NULL,0,NULL,NULL,NULL,'<p>Masyarakat perlu mengupayakan persatuan, salah satu bentuk upaya persatuan di lingkungan masyarakat adalah......</p>','<p>Menghindari forum temu warga</p>','<p>Meningkatkan sikap inklusif individu</p>','<p>Mengurangi kegiatan sosialisasi antar warga</p>','<p>Membatasi pergerakan ormas</p>','<p>Membubarkan acara temu warga</p>',0,0,0,0,0,0,1,2,NULL,1),('026c73f5-7436-4943-b91c-338d7c2cd7df','2023-10-23 15:47:29','2023-10-23 15:47:29',NULL,'00cc482f-6b53-42a2-9045-e1b555bb5d19',NULL,0,NULL,NULL,NULL,'<p>81 64 72 56 .... &hellip;. 54 40 45 32 36</p>','<p>66 38</p>','<p>61 42</p>','<p>32 39</p>','<p>63 48</p>','<p>30 32</p>',0,0,0,0,0,0,1,4,NULL,3),('0340042a-fe81-473c-a389-cef3b0fc514a','2023-10-20 14:50:52','2023-10-20 14:50:52',NULL,'00cc482f-6b53-42a2-9045-e1b555bb5d19',NULL,0,NULL,NULL,NULL,'<p>Sekelompok pecinta kucing terdiri dari 15 orang rata-rata memiliki 9 ekor kucing yang dipelihara. 3 orang yang memiliki rata-rata 3 ekor kucing bergabung dengan kelompok tersebut. Rata-rata banyaknya kucing dari kelompok tersebut adalah.....</p>','<p>4</p>','<p>6</p>','<p>8</p>','<p>10</p>','<p>12</p>',0,0,0,0,0,0,1,3,NULL,1),('03af31f5-a552-45d3-aba3-12e8770c85ec','2023-10-18 14:35:08','2023-10-18 14:35:08',NULL,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Saya dituduh dan dimarahi oleh ketua kelompok saya, sedangkan tuduhan itu tidak sesual dengan keadaan yang sebenarnya. Saya akan.....</p>','<p>Menanggapi pertanyaan siapapun dari isu Itu</p>','<p>Mencari penyebar isu tersebut dan memarahinya</p>','<p>Membiarkan isu itu berkembang dan, toh nanti berhenti sendiri</p>','<p>Menerangkan bagaimana keadaan yang sesungguhnya</p>','<p>Menceritakan pada teman dekat</p>',3,1,2,5,4,0,1,4,NULL,1),('03d19282-4348-4dae-9424-228475b35c7f','2023-10-16 14:38:20','2023-10-16 14:38:20',NULL,'6d64ab17-58b7-434c-8f5d-75d8a6ad4129',NULL,0,NULL,NULL,NULL,'<p>Pembangunan sebuah gedung direncanakan selesai dalam waktu 22 hari bila dikerjakan oleh 20 orang. Setelah dikerjakan 10 hari, pekerjaan dihentikan selama 6 hari. Supaya pembangunan itu selesai tepat pada waktunya, maka diperlukan tambahan pekerja sebanyak....</p>','<p>40 orang</p>','<p>30 orang</p>','<p>25 orang</p>','<p>20 orang</p>','<p>15 orang</p>',0,0,0,0,0,0,1,4,NULL,1),('043b7ccd-3f2c-464c-9036-1d2951b27c34','2023-10-18 11:38:32','2023-10-18 11:38:32',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>7,8 + 6 x &frac12; - 3 =</p>','<p>7,7</p>','<p>7,8</p>','<p>7,9</p>','<p>8,1</p>','<p>8,2</p>',0,0,0,0,0,0,1,2,NULL,1),('0506e91c-3292-48e5-b591-d3ac3490fb77','2023-10-14 15:15:10','2023-10-14 15:15:10',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Di wilayah Anda mengajar ada komunita GTT (Guru Tidak Tetap) yang terwadahi dalam PGRI. Melakukan penggalangan dana sukarela untuk berjuang ke Jakarta mengusulkan ke pemerintah agar diangkat sebagai PNS. Jika Anda adalah guru PNS yang telah menerima tunjangan profesi, apa yang akan Anda lakukan?</p>','<p>Mendukung sepenuhnya penggalangan dana itu dengan mengajak teman guru PNS lainnya untuk berpartisipasi dalam penggalangan dana.</p>','<p>Memberi nasehat kepada teman guru GTT untuk tidak terlalu berambisi diangkat sebagai PNS karena pengangkatan PNS ada aturannya.</p>','<p>Menaruh simpati terhadap upaya penggalangan dana itu meskipun tidak harus memberikan kontribusi dalam bentuk uang.</p>','<p>Berpartisipasi aktif dalam penggalangan dana itu agar memperoleh dana yang cukup dan mampu membayar perwakilan GTT ke Jakarta</p>','<p>Mengusulkan kepada pengurus PGRI daerah agar membayar perwakilan GTT untuk pergi ke Jakarta menyampaikan aspirasinya</p>',3,2,5,4,1,0,1,3,NULL,1),('05106425-9e42-483a-84ee-3364ba7248c7','2023-10-16 14:41:52','2023-10-16 14:41:52',NULL,'6d64ab17-58b7-434c-8f5d-75d8a6ad4129',NULL,0,NULL,NULL,NULL,'<p>Sebuah bangunan 2 lantai dapat diselesaikan oleh 8 orang dalam 4 hari. Berapa orang yang dibutuhkan untuk menyelesaikan bangunan 5 lantaldalam 3 hari?</p>','<p>21 orang</p>','<p>24 orang</p>','<p>25 orang</p>','<p>27 orang</p>','<p>30 orang</p>',0,0,0,0,0,0,1,4,NULL,1),('0564b321-860c-42d2-9290-709898d8cecb','2023-10-26 16:09:30','2023-10-26 16:09:30',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Tahun 2021 rencananya perusahaan anda akan mengadakan pelatihan gratis bahasa inggris yang dijadwalkan dilakukan setelah jam kerja selesai, sehingga membuat pulang kerja menjadi lebih sore, bagaimana sikap anda?</p>','<p>Sangat berminat untuk