rsebut</p>','<p>Memarahi mereka karena tidak mau mengikuti aturan dari pak RT</p>\n<p>&nbsp;</p>',1,3,5,2,4,0,1,3,NULL,1),('51d6b01c-ce33-45a6-99af-5e039e07b4f4','2023-10-16 14:27:17','2023-10-16 14:27:17',NULL,'6d64ab17-58b7-434c-8f5d-75d8a6ad4129',NULL,0,NULL,NULL,NULL,'<p>Seorang mahasiswa X harus mengerjakan sebuah essai dengan aturan sebagai berikut:</p>\n<p>- Soal 2 hanya boleh dikerjakan bersama soal 3</p>\n<p>- Soal 1 hanya boleh dikerjakan jika soal 5 tidak dikerjakan</p>\n<p>- Soal 2 tidak boleh dikerjakan jika soal 4 dikerjakan</p>\n<p>-Soal 5 hanya boleh dikerjakan bersama soal 6</p>\n<p>Jika mahasiswa tersebut harus memilih 3 soal dan tidak boleh mengerjakan soal 4, maka dia hanya boleh mengerjakan soal.</p>','<p>1, 2, dan 3</p>','<p>1, 5, dan 6</p>','<p>2, 3, dan 5</p>','<p>2, 5 dan 6</p>','<p>3, 5, dan 6</p>',0,0,0,0,0,0,1,1,NULL,1),('53380f62-de93-4ae7-bada-21fa612ee7c5','2023-10-17 10:52:12','2023-10-17 10:52:12',NULL,'c9bf618a-44bb-4b02-be4b-cea62c3216ef',NULL,0,NULL,NULL,NULL,'<p>Warga perumahan tempat anda tinggal mengadakan siskamling secara bergiliran. Sementara jadwal harian anda padat sehingga kadang anda sampai rumah sudah larut malam. Sikap anda adalah....</p>','<p>Meminta tetangga menggantikan jadwal anda dan memberikan kompensasi jika anda tidak bisa ikut siskamling</p>','<p>Membayar denda karena tidak mengikuti jadwal siskamling</p>','<p>Meminta jadwal siskamling di hari anda tidak sibuk</p>','<p>Berusaha menepati jadwal siskamling yang telah ditentukan dengan mengatur jadwal harian anda</p>','<p>Ikut jadwal siskamling yang anda bisa meskipun bukan jadwal anda</p>',2,1,4,5,3,0,1,4,NULL,1),('553502f1-68dc-46c3-91a3-5cd55ffca98d','2023-10-14 14:41:14','2023-10-14 14:41:14',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Di zaman ini banyak muncul pekerjaan - pekerjaan baru yang tidak pernah dipikirkan atau ada sebelumnya yang bahkan dapat menghasilkan pendapatan lebih banyak dari pada bekerja di kantor seperti gamer professional, youtuber, selebgram tetapi pandangan masyarakat terutama generasi tua mengenai hal tersebut masih dianggap hal yang negatif apalagi jika melihat anaknya menggunakan gadget sepanjang hari padahal belum tentu yang dilakukan anaknya negatif. Hal tersebut karena banyak pemberitaan negatif mengenai dampak buruk penggunaan gadget dan teknologi yang tidak tepat, sikap anda?...</p>','<p>Mendukung penggunaan gadget dan kemajuan teknologi selama tidak berlebihan dan tentunya bermanfaat serta terkontrol</p>','<p>Mengawasi penggunaan gadget pada anak</p>','<p>Membebaskan penggunaan gadget dan teknologi sebebas - bebasnya untuk mengembangkan diri</p>','<p>Membatasi penggunaan gadget dan teknologi agar tidak kecanduan</p>','<p>Menggunakan gadget dan teknologi secukupnya</p>',5,2,1,4,3,0,1,1,NULL,1),('55c354b7-247b-4e52-b32c-2f494d4258ab','2023-10-19 14:35:19','2023-10-19 14:35:19',NULL,'80cec561-fc0b-46c7-aed4-f0ad73061557',NULL,0,NULL,NULL,NULL,'<p>Ikut menjadi kelompok separatis yang menyerukan berdirinya wilayah sendiri merupakan pelanggaran terhadap Pancasila khususnya sila ke.....</p>','<p>Lima</p>','<p>Empat</p>','<p>Tiga</p>','<p>Dua</p>','<p>Satu</p>',0,0,0,0,0,0,1,3,NULL,1),('5678bc6c-df81-49f3-98c0-daddc1b9880e','2023-10-18 13:11:00','2023-10-18 13:11:00',NULL,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Beberapa tahun lagi anda akan memasuki usia pensiun dari salah satu instansi pemerintahan tempat anda bekerja selama ini. Tanggung jawab anda untuk mengabdi bagi negara pun telah selesai. Sekarang anda memasuki babak baru dimana tidak lagi terikat dengan pekerjaan dan pengabdian terhadap negara. Hal apa yang akan anda rencanakan untuk selanjutnya ketika waktu itu telah tiba&hellip;</p>','<p>Saya membuka usaha kecil-kecilan di rumah sambil menghabiskan hari tua saya dengan anak dan cucu cucu saya</p>','<p>Memiliki tanah di berbagai tempat strategis untuk investasi masa tua saya dan keluarga</p>','<p>Membuka lapangan kerja buat orang terdekat dan yang membutuhkan pekerjaan karena zaman sekarang sulit</p>','<p>Memiliki warisan harta yang berguna bagi anak cucu saya kelak ketika waktu tersebut sudah tiba</p>','<p>Beristirahat saja setiap hari di rumah menikmati hari tua saya bersama keluarga</p>',5,4,3,2,1,0,1,1,NULL,1),('5734916d-7c14-46de-b54e-28c13092e56b','2023-10-17 10:30:52','2023-10-17 10:30:52',NULL,'c9bf618a-44bb-4b02-be4b-cea62c3216ef',NULL,0,NULL,NULL,NULL,'<p>Anda mengikuti program Relawan Mengajar program pemerintah yang mengharuskan anda mengajar di daerah terpencil. Ditempat anda mengajar, masyarakatnya menganut kepercayaan animisme yang sudah mendarah daging dimana setiap satu bulan sekali merekamengadakan pesta penghormatan kepada leluhur. Sikap anda setelah melihat keadaan tersebut adalah.....</p>','<p>Mengikuti kegiatan pesta tersebut untuk menghormati masyarakat setempat</p>','<p>Mempelajari kebudayaan masyarakat setempat, selama tidak bertentangan dengan keyakinan anda, maka anda akan mengikuti kegiatan tersebut</p>','<p>Menghargai dan menghormati kebudayaan masyarakat setempat sebagai kekayaan budaya di Indonesia</p>','<p>Mengajukan permohonan pindah lokasi mengajar karena kebudayaan setempat tidak baik dengan keyakinan anda</p>','<p>Meminta izin kepada kepala warga agar tidak mengikuti kegiatan pesta penghormatan leluhur karena tidak sesuai dengan keyakinan anda</p>',2,5,4,1,3,0,1,2,NULL,1),('577b3af7-19b6-4de7-b40e-739c99ed849b','2023-10-26 13:37:13','2023-10-26 13:37:13',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Di era milenium perubahan dunia terjadi dengan cepat, perubahan tersebut merambat dalam kehidupan sehari-hari, maka saya......</p>','<p>Mengikuti perkembangan teknologi dan media massa</p>','<p>Mempelajari cara pengoperasian komputer</p>','<p>Meminta orang tua untuk melengkapi barang-barang elektronik</p>','<p>Berusaha mempelajari buku pengetahuan yang baru</p>','<p>Berusaha menguasai keterampilan di bidang teknologi informasi mutakhir</p>',3,4,1,2,5,0,1,5,NULL,1),('581a8118-9363-4acf-b1d9-1ef70d6a5854','2023-10-16 12:44:06','2023-10-16 12:44:06',NULL,'6d64ab17-58b7-434c-8f5d-75d8a6ad4129',NULL,0,NULL,NULL,NULL,'<p>Bendang : ....</p>','<p>Benteng</p>','<p>Sawah</p>','<p>Saluran air</p>','<p>Salur</p>','<p>Sungai</p>',0,0,0,0,0,0,1,2,NULL,1),('5862894a-dfd4-4378-9586-57f3e594c49a','2023-10-25 11:08:45','2023-10-25 11:08:45',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Anda sedang bekerja dikantor dan saat itu keadaan kantor sedang ramai dipenuhi tamu. Karena sedang berjalan terburu-buru. Anda tidak sengaja menabrak salah seorang tamu didekat anda kemudian barang yang sedang di bawa terjatuh. Anda langsung meminta maaf. Tetapi ternyata orang tersebut tidak terima dan marah-marah. Tindakan yang sebaiknya Anda ambil.....</p>','<p>Anda mengajak orang tersebut ke tempat sepi agar tidak menjadi pusat perhatian</p>','<p>Meninggalkan orang tersebut untuk menghindari masalah berkepanjangan</p>','<p>Membiarkan saja dia marah-marah didepan umum</p>','<p>Balas dendam dan mengatakan bahwa kemarahannya tidak pantas ditujukan kepada Anda</p>','<p>Menjaga perasaan agar tidak terpancing emosi</p>',4,3,2,1,5,0,1,5,NULL,1),('589c8b60-fbff-4f6e-a8bd-b3d928bf3d0a','2023-10-26 16:04:58','2023-10-26 16:04:58',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Setiap tahun dilakukan penilaian kinera untuk dasar usulan kenaikan golongan karyawan dan juga untuk promosi jabatan, setelah nilai di rekap alen manager SDM dokumen peniaian tersebut di masukkan amplop untuk dirahasiakan terlebih dahulu. Anda dipercaya oleh manager anda untuk menyimpan amplop tersebut dikarenakan manager anda mendadak harus cuti. Temandekat anda mencoba mencari tahu apakah dia masuk dalam promosi atau tidak melalui anda, bagaimana sikap anda?</p>','<p>Saya memberikan obat tersebut kepadanya, karena tidak ada yang tahu</p>','<p>Saya menjadi ragu-ragu</p>','<p>Saya berkonsultasi dengan rekan sejawat terlebih dahulu</p>','<p>Saya langsung menolaknya</p>','<p>Saya mencoba memberikan penjelasan ke pasien karena tidak berani langsung menolak takut pasien&nbsp;tersinggung</p>',2,1,5,3,4,0,1,3,NULL,1),('58b491be-acb6-4b10-bea9-ace35d39ea19','2023-10-16 12:48:24','2023-10-16 12:48:24',NULL,'6d64ab17-58b7-434c-8f5d-75d8a6ad4129',NULL,0,NULL,NULL,NULL,'<p>Muradif &gt;&lt;</p>','<p>SINONIM</p>','<p>Antonim</p>','<p>Homonim</p>','<p>Hiponim</p>','<p>Jamak</p>',0,0,0,0,0,0,1,2,NULL,1),('59881e2a-b87a-44db-9e59-e534ea5ee7c8','2023-10-16 16:18:40','2023-10-16 16:18:40',NULL,'c9bf618a-44bb-4b02-be4b-cea62c3216ef',NULL,0,NULL,NULL,NULL,'<p>Anda merupakan seorang karyawan pada sebuah perusahaan jasa yang bergerak dalam bidang transportasi. Siang ini akan di adakan sebuahdiskusi singkat dengan pimpinan perusahaan. Semua karyawan diminta untuk memberikan usulan terkait peningkatan kualitas pelayanan terhadap pelanggan kedepannya agar banyak dari customer yang memakai jasa perusahaan anda, sikap anda....</p>','<p>Memberikan usulan jika ingin meningkatkan pelayanan, perusahaan harus memenuhi semua hal yang diinginkan oleh pelanggan tanpa terkecuali</p>','<p>Mengusulkan adanya jalur khusus untuk ibu hamil dan menyusui dan para lansia</p>','<p>Mengusulkan agar pada hari libur massal biaya tiket didiskon hingga 50% sehingga banyak dari pelanggan yang akan menggunakan jasa perusahaan anda</p>','<p>Memberikan usulan agar perusahaan menyediakan fasilitas khusus bagi ibu hamil, menyusui dan lansia</p>','<p>Menyusulkan agar alat transportasi yang digunakan selalu bersih dengan cara merekrut karyawan baru dengan gaji tinggi</p>',1,2,3,5,4,0,1,4,NULL,1),('5ae09a8d-a6a7-49d3-a5d8-032bbe12b9bd','2023-10-18 11:14:06','2023-10-18 11:14:06',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>179, 177, 173, 167, &hellip;, &hellip;, &hellip;</p>','<p>170, 154, 169</p>','<p>150, 157, 135</p>','<p>125, 180, 135</p>','<p>159, 149, 137</p>','<p>115, 126, 148</p>',0,0,0,0,0,0,1,4,NULL,1),('5b63f8f3-cbdb-40bb-9e4d-d43c2981f7a0','2023-10-18 11:19:53','2023-10-18 11:19:53',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>69, 73, 61, 61, 49, 53, &hellip;, &hellip;, &hellip;, 33</p>','<p>41, 41, 39</p>','<p>35, 44, 44</p>','<p>26, 26, 32</p>','<p>52, 64, 64</p>','<p>39, 25, 25</p>',0,0,0,0,0,0,1,1,NULL,1),('5c25fd40-dcde-4343-8970-44f974f93a92','2023-10-13 14:53:31','2023-10-13 14:53:31',NULL,'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f',NULL,0,NULL,NULL,NULL,'<p>Enam mahasiswa yaitu A, B, C, D, E, dan F. masing-masing akan presentasi di depan kelas. Masing-masing hanya akan maju ke depan kelas satu kali saja dan sesuai dengan urutan sebagai berikut:</p>\n<ul>\n<li>C akan maju pada urutan keempat atau terakhir</li>\n<li>D akan menjadi pembicara ketiga setelah A</li>\n<li>B akan maju sebelum C</li>\n<li>F akan maju sebelum D</li>\n</ul>\n<p>Manakah dari pernyataan berikut yang benar?</p>','<p>D akan maju pada urutan ketiga</p>','<p>A akan maju pada urutan pertama</p>','<p>F akan maju pada urutan keenam</p>','<p>E akan maju pada urutan keenam</p>','<p>B akan maju pada urutan kedua</p>',0,0,0,0,0,0,1,1,NULL,1),('5ce7a4d9-3d55-4a0c-ae96-678ee2843ee8','2023-10-19 13:55:56','2023-10-19 13:55:56',NULL,'80cec561-fc0b-46c7-aed4-f0ad73061557',NULL,0,NULL,NULL,NULL,'<p>Dalam kondisi tidak mendesak atau diperlukan, timnas pencegahan korupsi menyampaikan laporan pelaksanaan stranas PK kepada Presiden secara berkala setiap.....kali</p>','<p>1 bulan</p>','<p>6 bulan</p>','<p>1 tahun</p>','<p>4 bulan</p>','<p>3 bulan</p>',0,0,0,0,0,0,1,2,NULL,1),('5f45b503-dc50-4b37-9cb4-61817ca6cd79','2023-10-14 14:23:55','2023-10-14 14:23:55',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Atasan di unit kerja saya melakukan mark up laporan keuangan yang dananya digunakan untuk menutupi tagihan rumah sakit orang tuanya. Sikap saya...</p>','<p>Merasa wajar saja karena hal itu sudah menjadi kebiasaan di banyak kantor</p>','<p>Langsung melaporkan kepada pihak pi