b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Rekan wanita dalam kelompok kerja anda tidak dipercaya untuk turut serta dalam suatu proyek luar daerah. Ternyata ketika anda mencari tahu kebenarannya, atasan anda menganggap bahwa seorang wanita tidak pantas untuk ikut dalam pekerjaan yang kompleks seperti proyek yang satu ini. Padahal, anda tahu bahwa rekan anda ini jauh lebih kompeten dan berwawasan dibanding anda. Menurut anda.....</p>','<p>Ini merupakan bentuk ketidakadilan yang perlu di selesaikan</p>','<p>Memberi tahu pihak atasan bahwa rekan anda ini berkompeten</p>','<p>Menyebarluaskan hal ini pada media sosial</p>','<p>Mempertanyakan keputusan atasan itu dan melaporkannya kepada pimpinan perusahaan</p>','<p>Perlu menggalang suara dari berbagai pihak agar dapat ditindaklanjuti</p>',4,5,1,3,2,0,1,2,NULL,1),('6ba4112a-785c-4dd6-a4dd-d54d6a5aa70f','2023-10-26 16:07:59','2023-10-26 16:07:59',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Disebuah perusahaan anda menjadi ketua tim dalam sebuah kegiatan, kemudian anda diminta memilih anggota tim untuk bekerjasama dengan anda, pertimbangan anda dalam memilih angora tim adalah......</p>','<p>yang sevisi saja</p>','<p>yang memiliki latar belakang yang berbeda</p>','<p>pentingnya pendapat atasan</p>','<p>yang mau bergabung</p>','<p>yang mudah bergaul dengan siapa saja</p>',5,2,4,1,3,0,1,1,NULL,1),('6be39165-5090-4d69-837a-7c43e686a047','2023-10-13 14:42:59','2023-10-13 14:42:59',NULL,'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f',NULL,0,NULL,NULL,NULL,'<p>Semua mobil dapat bergerak</p>\n<p>Semua mobil memiliki setir</p>\n<p>Kesimpulannya adalah...</p>','<p>Ada mobil dapat bergerak dan memiliki setir</p>','<p>Semua mobil dapat bergerak dan tidak memiliki setir</p>','<p>Semua mobil tidak dapat bergerak dan memiliki setir</p>','<p>Semua mobil dapat bergerak dan memiliki setir</p>','<p>Semua mobil dapat bergerak karena memiliki setir</p>',0,0,0,0,0,0,1,4,NULL,1),('6cb3439c-0a7a-4328-ab07-9478c9ac5e58','2023-10-14 15:25:36','2023-10-14 15:25:36',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Terdapat peserta didik yang mengadu kepada guru, bahwa ia selalu melakukan tugas piket kebersihan kelas sendiri. Anggota yang lain tidak mau terlibat membersihkan kelas. Mereka memaksa dan mengancam jika melaporkan tersebut pada wali kelas. Sebagai guru yang mengetahui hal tersebut, apa yang akan Anda lakukan?</p>','<p>Memberikan hukuman kepada seluruh anggota piket kebersihan karena tidak dapat membangun kerjasama yang baik dalam tugas yang menjadi tanggung jawab</p>','<p>Guru melakukan evaluasi keterlibatan siswa terkait kegiatan piket kebersihan kelas serta menyampaikan hasilnya agar menjadi perhatian seluruh siswa untuk terlibat dalam tanggung jawab tersebut</p>','<p>Memberikan teguran kepada siswa yang tidak mau terlibat dalam kegiatan piket kebersihan kelas agar siswa yang rajin tidak terpengaruh dan dia tidak mengulangi perbuatannya</p>','<p>Merekomendasikan guru BK untuk melakukan konseling kelompok untuk mengajarkan keterampilan bekerjasama dengan orang lain dalam suatu kelompok</p>','<p>Memfasilitasi pertemuan bersama agar terjadi komunikasi antar anggota kemlompok piket kebersihan sehingga anggira menyadari tugas masing-masing ketika jadwal piket kebersihan kelas berlangsung</p>',1,5,2,4,3,0,1,2,NULL,1),('700c9e5b-d0a3-4720-a2e3-4f9cfea65243','2023-10-19 14:47:18','2023-10-19 14:47:18',NULL,'80cec561-fc0b-46c7-aed4-f0ad73061557',NULL,0,NULL,NULL,NULL,'<p>Kejahatan genosida adalah setiap perbuatan yang dilakukan dengan maksud untuk menghancurkan atau memusnahkan seluruh atau sebagian kelompok bangsa, ras, etnis, dan agama. Berikut yang merupakan contoh dari kejahatan genosida yaitu.....</p>','<p>Perampasan kemerdekaan</p>','<p>Perbudakan</p>','<p>Pengusiran secara paksa</p>','<p>Memaksakan tindakan-tindakan yang bertujuan mencegah kelahiran di dalam kelompok</p>','<p>Penghilangan orang secara paksa</p>',0,0,0,0,0,0,1,4,NULL,1),('71b17e16-2dea-4d96-bb88-dc9d03266d37','2023-10-18 15:16:21','2023-10-18 15:16:21',NULL,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Terjadi konflik di tempat kerja anda karena atasan anda menyudutkan karyawannya yang selalu terlambat datang ke tempat bekerja, masalah tersebut menyerempet pada penyudutan agama, karena karyawan tersebut berasal dari agama minoritas, bagaimana tanggapan anda....</p>','<p>menganggap bahwa gejolak antar agama akan selalu ada namun penyudutan terhadap suku tidak dibenarkan sekalipun dilakukan oleh atasan anda</p>','<p>Ikut membenci suku tersebut karena sudah menjadi fakta bahwa orang yang berasal dari suku tersebut tidak profesional dalam bekerja</p>','<p>diperlukan agar indonesia mampu akarta a menghilangkan perbedaan agama</p>','<p>Indonesia perlu mencapai keseragaman agar tidak terjadi justifikasi antar agama karena sangat berpengaruh pada sudutpandang seseorang</p>','<p>perbedaan agama hanya menimbulkan masyarakat yang bercerai-berai</p>',5,1,4,2,3,0,1,1,NULL,1),('71e5424a-7214-478c-9ccc-468a3b954365','2023-10-18 15:33:51','2023-10-18 15:33:51',NULL,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Karena di tempat kerja saya memPHK semua karyawan termasuk saya. Saya terpaksa pindah bekerja di sebuah perusahaan penerbitan buku. Tempat bekerja saya sekarang membuat saya menjadi minoritas, saya lulusan pesantren yang sudah terbiasa dengan nilai dan norma agama yang ketat, namun lingkungan kerja saya rata-rata tidak memiliki agama yang pasti, maka sikap saya&hellip;..</p>','<p>Menyapa rekan kerja baru dan bersikap sewajarnya saja</p>','<p>Mengamati lingkungan kerja dan berusaha menyesuaikan diri dengan yang lain</p>','<p>Menyesal setiap hari karena bekerja di tempat yang menurut saya kotor</p>','<p>Menghormati satu sama lain dengan terpaksa</p>','<p>Berusaha bertahan karena memang harus bekerja</p>',2,5,1,3,4,0,1,2,NULL,1),('71fb8092-2e43-4016-ad27-0009b51d22b0','2023-10-26 16:12:37','2023-10-26 16:12:37',NULL,'6747b4a2-21ed-48fa-a0