88173','2023-10-25 13:24:37','2023-10-25 13:24:37',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Anda baru saja mengundurkan diri dari sebuah perusahaan karena terdapat masalah pribadi yang membuat anda tidak merasa Nyaman lagi dalam berkerja. Masalah tersebut disebabkan kekasih anda yang sudah menjalin hubungan bersama anda selama 5 tahun berselingkuh dengan seorang wanita kemudian memutuskan untuk menikahi wanita tersebut. Kebetulan kekasih anda merupakan rekan se kantor dan satu divisi dengan anda, kejadian ini membuat anda memilih untuk membuka lembaran baru dan keluar dari perusahaan. Setelah satu bulan memenangkan diri, anda diterima lagi di sebuah perusahaan baru yang lebih bonafit karena kecerdasan dan kompeten anda. Setelah beberapa bulan anda ditugaskan oleh perusahaan untuk bergabungmenangani suatu proyek dengan beberapa orang kompeten yang akan berkerja bersama anda, salah satu orang dalam tim tersebut yaitu wanita bernama Sinta yang merupakan istri dari mantan kekasih yang telah mengkhianati anda. Bagaimana anda menyikapinya....</p>','<p>Bekerja seperti biasa dengan mandiri dan penuh tanggung jawab</p>','<p>Bekerja seperti biasa dan pelan-pelan berdiskusi dengan atasan atas keberatan anda</p>','<p>Bekerja seperti biasa, namun menghindari berinteraksi dengan Sinta agar tidak terjadi konflik</p>','<p>Bekerja seperti biasa sesuai dengan protokol dan peraturan</p>','<p>Bekerja seperti biasa dengan didasari semangat kerja sama tim</p>',3,2,1,4,5,0,1,5,NULL,1),('862530cd-d893-4af2-bb57-8f5ae6c8f611','2023-10-14 14:39:22','2023-10-14 14:39:22',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Jika ada tawaran pekerjaan yang sebetulnya sangat cocok dengan minat dan bidang saya akan tetapi gajinya lebih kecil dari pekerjaan saat ini, maka saya....</p>','<p>Meminta pendapat dari keluarga saya karena ini juga berkaitan dengan mereka</p>','<p>Menerima tawaran tersebut karena pekerjaan yang sekarang sama sekali berada di l