'<p>Pada tahun ini dibuka seleksi penerimaan CPNS secara besar-besaran. Anda mencoba peruntungan anda dengan ikut mendaftar. Setelah anda melihat-lihat formasinya latar belakang pendidikan anda bersedia. Diluar daerah meski karena dari kecil anda tidak pernah lepas dari keluarga anda terlebih anda sering sakit dan memiliki riwayat penyakit maag, keluarga anda melarang untukmengikuti seleksi CPNS tahun ini namun anda sangat ingin mencoba kesempatan ini. Terlebih anda sudah belajar keras beberapa bulan sebelum pendaftaran dibuka. Maka hal yang harus anda lakukan......</p>','<p>Menerima saran dari orang tua untuk tidak mengikuti seleksi CPNS tahun ini</p>','<p>Tetap mengikuti seleksi CPNS secara diam-diam tanpa diketahui oleh pihak keluarga</p>','<p>Memberi pengertian kepada keluarga dan mengikuti seleksi CPNS</p>','<p>Mengikuti seleksi CPNS hanya untuk menguji kemampuan diri</p>','<p>Mengikuti seleksi CPNS dengan formasi apapun yang terdapat di daerah anda</p>',1,2,5,3,4,0,1,3,NULL,1),('8b4582ae-2082-4033-92b7-5ee5485e0cef','2023-10-20 13:55:13','2023-10-20 13:55:13',NULL,'00cc482f-6b53-42a2-9045-e1b555bb5d19',NULL,0,NULL,NULL,NULL,'<p>Untuk mengisi liburan panjang akhir semester, Lila, Indi, Lulu, Tata dan Doni sedang dalam perjalanan menuju sebuah tempat wisata di kota sebelah dengan mengendarai sepeda motor.</p>\n<ul>\n<li>Lila mengendarai sepeda motor dengan kecepatan lebih kecil daripada Indi tetapi tidak lebih besar daripada Tata</li>\n<li>Lulu mengendarai sepeda motor dengan kecepatan tidak lebih dari Tata dan tidak kurang Indi</li>\n<li>Doni mengendarai sepeda motor dengan kecepatan tidak lebih dari Indi dan tidak kurang dari Lili</li>\n</ul>\n<p>Jika Lulu sampai di tempat tujuan dalam waktu 35 menit dan Tata menghabiskan waktu 45 menit untuk sampai tempat tujuan,pernyataan yang benar adalah....</p>','<p>Indi sampai di tempat tujuan dalam waktu kurang dari 35 menit</p>','<p>Tata dan Lila sampai di tempat tujuan bersamaan</p>','<p>Doni sampai di tempat tujuan l