atu kali saja dan sesuai dengan urutan sebagai berikut:</p>\n<ul>\n<li>C akan maju pada urutan keempat atau terakhir</li>\n<li>D akan menjadi pembicara ketiga setelah A</li>\n<li>B akan maju sebelum C</li>\n<li>F akan maju sebelum D</li>\n</ul>\n<p>Dari urutan berikut, manakah yang memenuhi persyaratan tersebut ?...</p>','<p>E, F, A, C, B, D</p>','<p>A, F, C, D, B, E</p>','<p>E, F, A, B, D, C</p>','<p>B, A, F, E, D, C</p>','<p>F, A, D, E, B, C</p>',0,0,0,0,0,0,1,5,NULL,1),('9d4a5d8d-f40b-4a08-9a83-f5b144411feb','2023-10-18 10:57:09','2023-10-18 10:57:09',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>Setiap harinya di keluarga Susan, tugas mencuci piring, memasak dan berbelanja dilaksanakan oleh tiga orang. Keluarga Susan terdiri dari 5 anggota keluarga, yaitu ayah, ibu, Susan. Rano,dan Santi. Ayah tidak bertugas pada hari Rabu, Kamis, dan Sabtu. Ibu tidak dapat bertugas pada hari Rabu dan Sabtu. Susan hanya bisa bertugas pada hari Kamis dan Jumat. Rano hanya mencuci, memasak dan berbelanja pada hari Minggu. Santi hanya membantu pada hari Jumat dan Senin pada minggu pertama setiap bulannya. Anggota keluarga yang bertugas mencuci piring, memasak dan berbelanja pada tiap hari Jumat ialah....</p>','<p>Santi, Ibu, Ayah</p>','<p>Rano, Santi, Ibu</p>','<p>Ayah, Ibu, dan Susan</p>','<p>Ayah, Susan, dan Rano</p>','<p>Susan, Santi. Rano</p>',0,0,0,0,0,0,1,3,NULL,1),('9db1839d-7097-480a-bfa9-1f9ba4e136b9','2023-10-17 14:53:34','2023-10-17 14:53:34',NULL,'b6b3d933-7f1c-4ac1-abf2-14928a6ab49f',NULL,0,NULL,NULL,NULL,'<ol>\n<li>Bangsa Indonesia menyatakan kepercayaanya dan ketaqwaanya kepada Tuhan Yang Maha Esa.</li>\n<li>Mengembangkan sikap saling mencintai sesama manusia.</li>\n<li>Memajukan pergaulan demi persatuan dan kesatuan bangsa.</li>\n<li>Keputusan yang diambil harus dapat dipertanggungjawabkan secara moral kepada Tuhan Yang Maha Esa, menjunjung tinggi harkat dan</li>\n<li>martabat manusia, nilai-nilai kebenaran dan keadilan mengutamakan persatuan