eda motor.</p>\n<p>Lila mengendarai sepeda motor dengan kecepatan lebih kecil daripada Indi tetapi tidak lebih besar daripada Tata</p>\n<ul>\n<li>Lulu mengendarai sepeda motor dengan kecepatan tidak lebih dari Tata dan tidak kurang Indi.</li>\n<li>Doni mengendarat sepeda motor dengan kecepatan tidak lebih dari Indi dan tidak kurang dari Lili</li>\n</ul>\n<p>Bagaimanakah urutan anak yang mengendarai sepeda motor dengan kecepatan paling kecil ?</p>','<p>Lila-Doni-Indi-Lulu-Tata</p>','<p>Lila-Indi-Doni-Lulu-Tata</p>','<p>Doni-Lulu-Tata-Indi-Lila</p>','<p>Tata-Lulu-Indi-Lila-Doni</p>','<p>Tata-Lulu-Indi-Doni-Lila</p>',0,0,0,0,0,0,1,1,NULL,1),('9f9c2653-0d4c-4f6c-af5c-35d297426870','2023-10-25 13:22:13','2023-10-25 13:22:13',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Anda adalah seorang ASN senior di sebuah instansi suatu hari anda mendapat video dari salah satu group WhatsApp anda tentang pengangkatan honorer yang sudah mengabdi lebih dari 8 tahun menjadi PNS tanpa tes. Anda sangat bahagia dengan berita tersebut karena mayoritas rekan-rekan kerja anda adalah honorer yang sudah mengabdi bertahun-tahun namun belum diangkat. Setiap hari ketika melihat rekan anda yang merupakan honorer tetapi sangat berdedikasi dalam berkerja, anda berdoa dengan tulus agar mereka segera diangkat menjadi ASN untuk mendapatkan kehidupan yang lebih baik dengan penghasilan yang lebih layak. Informasi dari video yang anda dapatkan dari satu grup WhatsApp tersebut bagikan jawaban dari doa-doa anda selama ini. Tanpa pikir panjang, anda segera membagikannya ke grup sekolah anda dan dalam sekejap banyak ucapansyukur, optimis dan terima kasih dari rekan-rekan anda yang merasa bahagia dengan informasi tersebut. Beberapa rekan anda yang merupakan ASN baru dan masih sangat mudah, pesan tersebut berisi informasi bahwa berita yang baru anda kirimkan adalah hoax dan ia juga menyatakan bukti-bukti valid bahwa video tersebut hanyalah hoax, maka hal yang sebaiknya anda lakukan.......</p>','<p>Mengucapkan terima kasih atas informasi yang telah diberikan junior anda</p>','<p>Segera mengklarifikasi di grup WhatsApp kantor bahwa berita yang anda sampaikan tidak benar</p>','<p>Mengucapkan terima kasih atas informasi yang diberikan junior anda dan memintanya untuk tetap diam sampai suasana kondusif</p>','<p>Berterimakasih pada junior anda dan menunggu waktu yang tepat untuk mengklarifikasi berita di grup</p>','<p>Berterimakasih pada junior anda dan meminta maaf serta mengklarifikasi di grup kantor</p>',3,4,1,2,5,0,1,5,NULL,1),('9f9eda79-c464-43b5-ae0b-a7f56385c384','2023-10-17 11:08:40','2023-10-17 11:08:40',NULL,'c9bf618a-44bb-4b02-be4b-cea62c3216ef',NULL,0,NULL,NULL,NULL,'<p>Anda adalah pegawai divisi pelaksanaan dan perencanaan proyek pada suatu perusahaan swasta. Perusahaan tersebut meminta para pegawainya untuk mengisi laporan harian kegiatan secara online melalui aplikasi web. Namun, anda sering bekerja di lapangan sehingga membuat pengisian laporan harian kegiatan terkendala sinyal, maka sikap anda sebaiknya...</p>','<p>Meminta kelonggaran pada atasan untuk membuat laporan harian kegiatan secara manual</p>','<p>Meminta teman yang berada di lokasi yang memiliki sinyal bagus untuk mengisi laporan harian kegiatan milik anda</p>','<p>Saat anda berada di tempat dengan sinyal yang buruk, anda menunda pengisian laporan harian kegiatan keesokan saja</p>','<p>Berusaha mencari tempat dengan sinyal yang baik untuk dapat mengisi laporan harian kegiatan harian</p>','<p>Mengisi laporan harian kegiatan di kantor saat sedang tidak bekerja di lapangan</p>',1,3,4,5,2,0,1,4,NULL,1),('9fd970df-f2b9-466c-a65f-b6433f713166','2023-10-14 12:08:30','2023-10-14 12:08:30',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Pada sebuah diskusi dengan tim kerja yang terdiri dari rekan-rekan kerja Anda di kantor biasanya saya adalah...</p>','<p>Pendengar dan pengamat yang baik dalam diskusi</p>','<p>Lebih banyak mendengar dan berbicara sekadarnya</p>','<