n konsumen ke satpam karena satpam lebih mudah dimintai bantuan</p>','<p>Mengarahkan konsumen ke loket yang seharusnya, yaitu loket administrasi yang berada di lantai dua. Semua itu sudah sesuai dengan aturan yang diberlakukan</p>','<p>Memberi saran ke konsumen bahwa sebaiknya dia membawa rekan atau saudara yang bisa membantu keperluannya karena perlu diingat bahwa dia difabel</p>','<p>Mencari rekan pengganti untuk&nbsp; loket yang saya jaga, kemudian membantukonsumen untuk kepengurusan administrasi menuju lantai dua</p>',4,3,2,1,5,0,1,5,NULL,1),('ac619f33-d55d-45f4-b8b6-df588c510d42','2023-10-13 13:52:26','2023-10-13 13:52:26',NULL,'dfcc80d7-7e2f-4c19-88cc-d69371bbee12',NULL,0,NULL,NULL,NULL,'<p>Sutomo atau yang akrab disapa Bung Tomo merupakan pahlawan yang terkenal karena peranannya dalam membangkitkan semangat arek-arek Suroboyo untuk melawan penjajah Belanda melalui tentara NICA, yang berakhir dengan pertempuran 10 November 1945 dan.kini diperingati sebagai Hari Pahlawan. Sikap dan perilaku yang dilakukan oleh Bung Tomo disebut...</p>','<p>Patriotisme</p>','<p>Nasionalisme</p>','<p>Natonality</p>','<p>Nation</p>','<p>Negara</p>',0,0,0,0,0,0,1,1,NULL,1),('ac8ab501-5ab1-4bf1-968e-a267c66f8ccf','2023-10-18 12:21:27','2023-10-18 12:21:27',NULL,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Jika anda mendapatkan tugas dari pimpinan namun anda tidak menyukai tugas tersebut, anda akan...</p>','<p>meminta rekan kerja anda yang mengerjakan</p>','<p>bernegosiasi dengan atasan agar pekerjaannya tidak terlalu rumit</p>','<p>tetap menyelesaikannya dan berkonsultasi dengan atasan</p>','<p>tetap menyelesaikan dan meminta bantuan rekan anda</p>','<p>meminta rekan kerja anda membantu anda menyelesaikannya</p>',2,1,5,4,3,0,1,3,NULL,1),('acc76bb8-f360-4863-8bab-f20817210f41','2023-10-14 14:29:48','2023-10-14 14:29:48',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Ketua RT tempat saya tinggal mengirimkan pesan untuk mencetak undangan rapat