l menurut kakak anda perusahaan tersebut akan membuat kakak anda berkembang, bagaimana menurut anda....</p>','<p>mewajarkan sudut pandang orang tua anda yang mugkin khawatir terhadap kakak anda, dan menyadari bahwa orang tua anda masih berpikir secara tradisional</p>','<p>setuju dengan pikiran kedua orang tua anda karena kita harus menjauhi orang yang berbeda dengan kita</p>','<p>merasa takut terhadap teman yang latar belakang budaya dan agamanya beda</p>','<p>memutuskan pertemanan dengan orang yang latar belakangnya berbeda</p>','<p>membantu kakak pertama anda agar tetap dapat bekerja</p>',5,2,3,1,4,0,1,1,NULL,1),('af007e97-ba24-4122-9bf6-59f269229940','2023-10-16 11:59:05','2023-10-16 11:59:05',NULL,'7353afdf-8c22-4e71-a553-90921b9692ab',NULL,0,NULL,NULL,NULL,'<p>Berdasarkan posisi seseorang dalam organisasi, konflik dapat dibedakan menjadi empat konflik, salah satunya yaitu konflik horizontal. Wujud sikap untuk mencegah terjadinya konflik horizontal adalah</p>','<p>Mengimplementasikan sila ke lima dengan memberikan upah buruh sesuai dengan standar peraturan pemerintah berdasarkan nilai keadilan</p>','<p>Mengusahakan tidak memegang dua peran atau jabatan sekaligus dalam sebuah organisasi</p>','<p>Memilih penasihat organisasi yang mampu berdiskusi dengan baik dan memiliki komitmen untuk memajukan organisasi</p>','<p>Memberikan bonus kepada pegawai dengan pencapaian kerja terbaik setiap bulannya</p>','<p>Berkomunikasi dengan terbuka dan menghormati pendapat setiap orang dalam melakukan diskusi dengan cara musyawarah untukmencapai mufakat agar tidak menimbulkan perbedaan persepsi dan konflik berkelanjutan</p>',0,0,0,0,0,0,1,5,NULL,1),('af396a1c-7470-435a-ba5d-ae530f50d9e5','2023-10-17 11:10:12','2023-10-17 11:10:12',NULL,'c9bf618a-44bb-4b02-be4b-cea62c3216ef',NULL,0,NULL,NULL,NULL,'<p>Saat anda sedang mengerjakan suatu tugas di salah satu aplikasi perusahaan, ternyata aplikasi tersebut mengalami eror sehingga mengganggu pekerjaan anda. Sikap anda sebaiknya....</p>','