rangkat, saya memilih libur</p>','<p>Mengusulkan pada atasan agar hari Jumat diliburkan</p>',4,3,2,5,1,0,1,4,NULL,1),('ebdaca98-f6ea-4a24-a511-ffe99758b8ab','2023-10-13 12:54:59','2023-10-13 12:54:59',NULL,'dfcc80d7-7e2f-4c19-88cc-d69371bbee12',NULL,0,NULL,NULL,NULL,'<p>Keikutsertaan warga negara selain dapat dilakukan melalui Pendidikan Kewarganegaraan, pelatihan kemiliteran, dan pengabdian prajurit semata, namun juga dapat dilakukan dengan jalan pengabdian profesi yang tercantum dalam...</p>','<p>Pasal 27 ayat 3</p>','<p>Inpres 7 Tahun 2015</p>','<p>Pasal 9 ayat 2 UU No.3 Tahun 2002</p>','<p>UU No. 39 Tahun 1999</p>','<p>Pasal 8 ayat 7</p>',0,0,0,0,0,0,1,3,NULL,1),('ec245bc0-4bf8-415e-b90e-50820990d2ff','2023-10-20 13:21:45','2023-10-20 13:21:45',NULL,'00cc482f-6b53-42a2-9045-e1b555bb5d19',NULL,0,NULL,NULL,NULL,'<p>Telatah : .....</p>','<p>Gerak</p>','<p>Latah</p>','<p>Desa</p>','<p>Kebiasaan</p>','<p>Gerak-gerik</p>',0,0,0,0,0,0,1,5,NULL,1),('edec9e23-80b3-435d-93aa-2444074f8420','2023-10-13 15:16:04','2023-10-13 15:16:04',NULL,'e9f84a80-562c-4b59-b70d-8f1c9f4e3b4f',NULL,0,NULL,NULL,NULL,'<p>Pada suatu kelas terdapat 12 siswa laki-laki dan 18 siswa perempuan. Jika rata-rata hasil tes IQ siswa laki-laki 110, rata-rata hasil tes IQ siswa perempuan 120, rata-rata hasil tes IQ seluruh siswa dalam kelas adalah........</p>','<p>116,8</p>','<p>116,4</p>','<p>116</p>','<p>115</p>','<p>114,6</p>',0,0,0,0,0,0,1,3,NULL,1),('eebd5cd6-6fcb-498d-a5bf-168d7327a6d4','2023-10-18 12:31:36','2023-10-18 12:31:36',NULL,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Saya menyelesaikan pekerjaan dengan</p>','<p>hasil sesuai standar perusahaan</p>','<p>hasil yang maksimal</p>','<p>hasil yang seadanya</p>','<p>hasil yang sangat baik</p>','<p style=\"text-align: left;\">hasil yang cukup baik</p>',2,5,1,4,3,0,1,2,NULL,1),('eeedb981-a184-4190-b330-50fc7b4c0aea','2023-10-26 15:59:10','2023-10-26 15:59:10',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p