L,'9c9476b6-b195-4898-823b-4c2feca2426c',NULL,0,NULL,NULL,NULL,'<p>Jika anak buah anda yang memiliki kemampuan khusus dan diandalkan sering terlambat hadir dan keadaan ini telah mengganggu kegiatan operasional instansi. Maka tindakan yang akan dilakukan adalah....</p>','<p>Mengeluarkan surat peringatan</p>','<p>Membiarkannya karena sudah seringkali ditegur tapi tidak ada perubahan perilaku</p>','<p>Memindahkannya ke luar daerah</p>','<p>Menjatuhkan skorsing</p>','<p>Mengatur ulang jam kerja khusus untuknya, sehingga dia harus pulang lebih lama dari jam kerja normal</p>',3,1,2,4,5,0,1,5,NULL,1),('f1b6a43a-cfe2-467c-bc63-b06570e43bd7','2023-10-18 11:52:33','2023-10-18 11:52:33',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>Dua orang pengendara sepeda melakukan start pada suatu rute dari suatu titik yang sama dengan selisih waktu 3 jam. Pengendara kedua bersepeda dengan kecepatan 10 km/jam dan memulai perjalanannya 3 jam setelah pengendara pertama yang berkecepatan 6 km/jam. Berapa waktu yang dibutuhkan pengendara kedua untuk menyusul pengendara pertama, terhitung dari saat pengendara kedua memulai perjalanannya ?</p>','<p>5 &frac34; jam</p>','<p>2 jam</p>','<p>6 jam</p>','<p>4 &frac12; jam</p>','<p>3 jam</p>',0,0,0,0,0,0,1,4,NULL,1),('f1ca7c81-101d-496e-9808-39e892e5fa30','2023-10-16 12:18:39','2023-10-16 12:18:39',NULL,'7353afdf-8c22-4e71-a553-90921b9692ab',NULL,0,NULL,NULL,NULL,'<p>Tujuan Nasionalisme juga didasari dari semangat gotong royong yaitu kedalam dan ke luar ke dalam berarti.....</p>','<p>Kemajemukan dan keanekaragaman budaya, suku, etnis, agama yang mewarnai kebangsaan Indonesia, tidak boleh dipandang sebagai hal negatif dan menjadi ancaman yang bisa saling menegaskan</p>','<p>memuliakan kemanusiaan universal, dengan menjunjung tinggi persaudaraan, perdamaian dan keadilanantarumatmanusia</p>','<p>memuliakan kemanusiaan universal</p>','<p>menjunjung tinggi persaudaraan, perdamaian dan keadilan antar umat manusia</p>','<p>bahwa kesetiaan yang tertinggi terdapat harus diserahkan pada negara kebangsaan</p>',0,0,0,0,0,0,1,1,NULL,1),('f2074584-ca85-47b5-bc57-52d5cf9051b8','2023-10-17 12:33:32','2023-10-17 12:33:32',NULL,'c9bf618a-44bb-4b02-be4b-cea62c3216ef',NULL,0,NULL,NULL,NULL,'<p>Sehubungan dengan perjalanan dinas, kantor Anda memberikan jatah uang makan sebesar Rp.500.000,- untuk makan siang setiap harinya. Uang tersebut akan diganti sesuai dengan bukti pembayaran makan siang. Namun menurut Anda makan siang Anda selama ini tidak sebesar jumlah tersebut. Oleh karena itu Anda akan ...</p>','<p>Makan secukupnya dengan kwitansi yang sebenarnya</p>','<p>Tetap makan dengan jumlah tersebut demi mendapatkan uang reimburse</p>','<p>Makan dengan jumlah yang secukupnya menurut Anda</p>','<p>Makan secukupnya tapi memalsukan kwitansinya</p>','<p>Ikut bagaimana rekan saya yang lain saja</p>',5,2,4,1,3,0,1,1,NULL,1),('f23fb2da-0be4-4364-bbc7-22a132270822','2023-10-25 11:13:27','2023-10-25 11:13:27',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Anda adalah salah satu karyawan di suatu perusahaan yang bergerak dibidang konstruksi. Saat jam istirahat ada seorang klien dari luar kota ingin menemui anda klien tersebut terburu-buru karena harus menuju bandara untuk pulang ke daerahnya. Sikap anda......</p>','<p>Segera menemuinya dan menanyakan kepentingannya</p>','<p>Menyuruhnya untuk menunggu</p>','<p>Meminta teman anda untuk menemuinya</p>','<p>Menyuruhnya untuk kembali lain kali</p>','<p>Tidak mau menemuinya karena anda sedang istirahat</p>',5,4,3,2,1,0,1,1,NULL,1),('f2a8ab1e-b36b-4e52-8f85-73dfccb14da9','2023-10-18 10:15:28','2023-10-18 10:15:28',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p><img src=\"/storage/upload_files/questions/20231018101403soal 34.jpg\" alt=\"\" width=\"500\" height=\"163\" /></p>','<p>Gambar A</p>','<p>Gambar B</p>','<p>Gambar C</p>','<p>Gambar D</p>','<p>Gambar E</p>',0,0,0,0,0,0,1,4,NULL,1),('f2e08e75-e10a-4f0c-8ea9-81e367c64c30','2023-10-14 12:30:36','2023-10-14 12:30:36',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Kita hidup di negara yang memiliki ragam kepercayaan, budaya dan adat istiadat yang berbeda-beda. Di perusahaan anda sendiri terdiri dari orang orang yang berbeda latarbelakang, banyak karyawan muslim yang mengeluhkan sulitnya beribadah karena ketersediaan tempat atau pada jam untuk beribadah mereka harus tetap bekerja, sikap anda&hellip;</p>','<p>Akan memfasilitasi tempat untuk beribadah mereka di lingkungan perusahaan</p>','<p>Mendiskusikan hal ini dengan jajaran pimpinan dan pemilik perusahaan untuk dicari solusinya</p>','<p>Karena pemilik perusahaan seorang non muslim, maka itu sudah menjadi aturan yang harus dipatuhi karyawan</p>','<p>Memberikan kebijakan yang bersifat toleran kepada karyawan</p>','<p>Bersifat toleran dan menyediakan semua fasilitas ibadah karyawan</p>',3,5,1,2,4,0,1,2,NULL,1),('f4b62e9f-9374-45ca-82fb-6a600264a7cb','2023-10-25 11:11:41','2023-10-25 11:11:41',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Perusahaan anda sering menjalin hubungan dengan perusahaan asing untuk keperluan ekspor-impor. Suatu hari ada seorang klien berkebangsaan asing menemui anda untuk berkonsultasi anda tidak mengerti bahasa yang ia gunakan, sikap anda.....</p>','<p>Meminta bantuan rekan anda yang memahami bahasa orang asing tersebut untuk menerjemahkan ketika anda sedang berbicara dengannya</p>','<p>Menyuruh rekan anda yang memahami bahasa orang asing tersebut untuk menemuinya</p>','<p>Meminta orang asing tersebut untuk datang lain kali dan membawah penerjemah</p>','<p>Menolak untuk menemuinya karena takut tidak paham</p>','<p>Berpura-pura memahami pembicaraanya</p>',5,4,3,2,1,0,1,1,NULL,1),('f4c4047b-a7ba-4d1a-a207-121d6765f91b','2023-10-25 13:27:25','2023-10-25 13:27:25',NULL,'6747b4a2-21ed-48fa-a0ea-bc2e9e29247d',NULL,0,NULL,NULL,NULL,'<p>Saya ditugaskan untuk memimpin tim kerja dengan batas waktu yang sangat ketat. Anggota tim kerja memperlihatkan sikap tidak peduli dengan tugas yang diemban. Sikap saya adalah....</p>','<p>Bekerja sendiri yang penting tugas selesai</p>','<p>Mengancam mengeluarkan anggota yang tidak serius dari tim kerja</p>','<p>Melaporkan mereka pada pimpinan agar di beri sanksi</p>','<p>Membagi tugas secara adil dan memotivasi anggota untuk menyelesaikannya</p>','<p>Menasihati mereka agar sadar akan penyelesaian tugas yang di embannya</p>',2,1,3,5,4,0,1,4,NULL,1),('f4c6027d-2afa-49a1-9667-3db330acac36','2023-10-18 11:09:55','2023-10-18 11:09:55',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>Titi lebih muda dari pada Sasa, Sasa lebih muda dari pada Adit dan Parjiman, kesimpulan yang tepat adalah...</p>','<p>Titi paling muda diantara mereka</p>','<p>Sasa paling tua diantara semuanya</p>','<p>Adit dan Parjiman mempunyai umur yang sama</p>','<p>Umur Titi dan Sasa sama</p>','<p>Parjiman lebih muda dari pada Sasa</p>',0,0,0,0,0,0,1,1,NULL,1),('f52c19dc-76f0-4dc2-9889-8db7ca7f3c87','2023-10-14 12:18:32','2023-10-14 12:18:32',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Dalam sebuah rapat RT diusulkan supaya seluruh warga kerja bakti membantu dalam pembangunan gedung pertemuan RT yang sedang dikerjakan oleh kontraktor berpengalaman. Menurut saya....</p>','<p>Hal itu kurang diperlukan karena pembangunan gedung pertemuan sudah dikerjakan oleh ahlinya</p>','<p>Lebih baik kerja bakti dilakukan untuk kebersihan lingkungan saja</p>','<p>Sangat tidak diperlukan karena RT telah keluar uang banyak untuk kontraktor tersebut</p>','<p>Penting untuk mempererat kebersamaan antar warga RT</p>','<p>Penting untuk menumbuhkan rasa memiliki warga RT terhadap fasilitas gedung pertemuan tersebut</p>',4,5,1,2,3,0,1,2,NULL,1),('f53ebdb0-9fd0-4885-921b-a0d6b4d687e5','2023-10-19 14:45:32','2023-10-19 14:45:32',NULL,'80cec561-fc0b-46c7-aed4-f0ad73061557',NULL,0,NULL,NULL,NULL,'<p>Pada masa pensiun yang cukup panjang, seseorang sebaikanya mempertimbangkan dampak tingkat kenaikan harga atau inflasi. Ketidakpastian biaya hidup di masa depan adalah salah satu kompleksitas terbesar dari proses perencanaan keuangan pensiun.</p>\n<p>Keberadaan inflasi menjadi suatu hambatan bagi para pensiunan. Namun, di masa pensiun, umumnya sebuah keluarga akan membutuhkan penghasilan yang lebih sedikit dibandingkan saat masa produktifnya. Secara standar, berdasarkan Vanguard Guide to Investing During Retirement, panduan umum sebuah keluarga akan membutuhkan 80% dari penghasilan saat ini di masapensiunnya kelak. Meskipun demikian, jumlah ini dapat bervariasi tergantung dari beberapa faktor diantaranya Jumlah penghasilan secara nominal saat mendekati pensiun, kondisi kesehatan, usia saat mulai pensiun dan ekspektasi gaya hidup. (Pension ready, Pension happy).</p>\n<p>Makna kata pensiun dalam paragraf di atas adalah.....</p>','<p>Sudah tidak bekerja lagi dan mendapat uang sara</p>','<p>Apa yang sudah dialami</p>','<p>Jabatan hamba raja</p>','<p>Pengar merasa berat di kepala</p>','<p>Pemberian akan tanda sudah takluk</p>',0,0,0,0,0,0,1,1,NULL,1),('f5ac959f-1c72-4d12-ac42-50e03ce02078','2023-10-17 11:58:00','2023-10-17 11:58:00',NULL,'c9bf618a-44bb-4b02-be4b-cea62c3216ef',NULL,0,NULL,NULL,NULL,'<p>Saya bekerja sebagai teller di bank, pada suatu waktu ada pelatihan yang harus saya ikuti dan dalam pelatihan tersebut diajarkan gerakan 3S yaitu Senyum, Sapa dan Salam yang harus diterapkan dalam pekerjaan saya sehari-hari maka sikap saya setelah pelatihan kepegawaian tersebut adalah...</p>','<p>Saya akan mulai gerakan 3S hanya jika saya sudah siap</p>','<p>Melakukan seperti yang saya lakukan setiap hari karena kawatir gerakan 3S akan tampak seperti suatu hal yang aneh bagi orang lain</p>','<p>Menerapkan gerakan 3S seperti yang diajarkan dalam pelatihan</p>','<p>Cukup dengan melakukan gerakan 3S hanya jika dilihat oleh pimpinan sehingga terlihat bahwa saya sudah melakukan anjuran pelatihan tersebut</p>','<p>Menerapkan gerakan 35 seperti yang diajark