. Maka hal yang harus anda lakukan......</p>','<p>Memberi pengertian kepada atasan anda tentang belanja online, salah satunya produk yang tidak sesuai ekspektasi</p>','<p>Memberi pengertian kepada atasan anda dan segera menulis ulasan sesuai keadaan aslinya pada toko online tersebut</p>','<p>Memberikan pengertian kepada atasan anda dan mencari info lebih dalam terkait produk tersebut</p>','<p>Memberi pengertian kepada atasan anda dan menghubungi penjual agar barang segera diganti</p>','<p>Memberi pengertian kepada atasan anda dan segera memberi rating rendah pada toko tersebut</p>',3,4,5,2,1,0,1,3,NULL,1),('f7274a38-bc54-4959-97f0-3a1f10488052','2023-10-13 13:31:20','2023-10-13 13:31:20',NULL,'dfcc80d7-7e2f-4c19-88cc-d69371bbee12',NULL,0,NULL,NULL,NULL,'<p>Makna dari wawasan kebangsaan Indonesia yaitu mengamanatkan kepada seluruh bangsa agar menempatkan persatuan dan kesatuan serta kepentingan dan keselamatan bangsa dan negara di atas kepentingan pribadi dan golongan. Faktor penghambat wawasan kebangsaan Indonesia diantaranya, kecuali....</p>','<p>Pikiran dan perasaan kecemburuan sosial</p>','<p>Kesenjangan pembangunan antar wilayah</p>','<p>Kesenjangan sosial dan ekonomis antar golongan penduduk</p>','<p>Konsep wawasan nusantara dan ketahanan nasional sebagai acuan operasional</p>','<p>Upaya-upaya untuk mengekang proses demokratisasi dan desentralisasi</p>',0,0,0,0,0,0,1,4,NULL,1),('f7e92d41-5394-4e66-9ecb-5a6f2275addb','2023-10-25 10:57:39','2023-10-25 10:57:39',NULL,'00cc482f-6b53-42a2-9045-e1b555bb5d19',NULL,0,NULL,NULL,NULL,'<p><img src=\"/../storage/upload_files/questions/20231025105528Soal 65.jpg\" alt=\"\" width=\"557\" height=\"253\" /></p>','<p>Gambar A</p>','<p>Gambar B</p>','<p>gambar C</p>','<p>Gambar D</p>','<p>Gambar E</p>',0,0,0,0,0,0,1,2,NULL,1),('f8539db5-179d-4fef-b5ee-15997f6833d8','2023-10-14 14:44:07','2023-10-14 14:47:28',NULL,'24bf9ebb-5643-42af-b6ad-4b54d6de83c4',NULL,0,NULL,NULL,NULL,'<p>Saya akan turut memberikan kontribusi terhadap pemban