n anak kenalan anda</p>','<p>Mendiamkannya saja dan tidak memperdulikan permintaan kenalan anda</p>','<p>Meminta teman untuk melayani anak kenalan anda</p>',4,5,1,3,2,0,1,2,NULL,1),('fe88dbae-5ced-49b8-9140-44422333d7a5','2023-10-13 13:42:43','2023-10-13 13:42:43',NULL,'dfcc80d7-7e2f-4c19-88cc-d69371bbee12',NULL,0,NULL,NULL,NULL,'<p>Wawasan Nusantara adalah cara pandang bangsa Indonesia tentang diri dan lingkungannya berdasarkan ideologi nasionalnya yang dilandasi oleh Pancasila dan UUD 1945 yang merupakan aspirasi bangsa Indonesia yang merdeka, berdaulat, dan bermanfaat serta menjiwai tata hidup dan tindak kebijakannya dalam mencapai tujuan nasional. Tujuan wawasan nusantara terbagi menjadi tujuan ke dalam dan tujuan ke luar. Tujuan ke luar wawasan nusantara yaitu...</p>','<p>Untuk mewujudkan kesatuan dalam segenap aspek kehidupan bangsa, baik aspek alamiah maupun aspek social</p>','<p>Untuk ikut serta mewujudkan kebahagiaan, ketertiban, dan perdamaian seluruh umat manusia</p>','<p>Kemajemukan dan keanekaragaman budaya, suku, etnis, agama yang mewarnai kebangsaan Indonesia, tidak boleh dipandang sebagai hal negatif dan menjadi ancaman yang bisa saling menegaskan.</p>','<p>memuliakan kemanusiaan universal</p>','<p>kesetiaan yang tertinggi terdapat harus diserahkan pada negara kebangsaan</p>',0,0,0,0,0,0,1,2,NULL,1),('ff73d2ac-77f9-4ba1-9bc8-2912b71512a2','2023-10-18 10:52:30','2023-10-18 10:52:30',NULL,'557e3be9-1ea4-45e4-8163-29eb4435e058',NULL,0,NULL,NULL,NULL,'<p>Mahasiswa S1 baru dapat gelar Sarjana jika sudah lulus ujian Skripsi. Rina dan Nisa adalah sarjana S1. Jadi...</p>','<p>Rina dan Nisa pasti mampu mengikuti ujian Skripsi</p>','<p>Nisa tidak lulus ujian Skripsi</p>','<p>Rina tidak lulus ujian Skripsi</p>','<p>Rina dan Nisa belum tentu mampu mengikuti ujian Skripsi</p>','<p>Rina lebih cerdas daripada Nisa</p>',0,0,0,0,0,0,1,1,NULL,1);

